      distribution: fixed
      value: 2.3
    gamma:
      distribution: uniform
      low: 0.222222222222222
      high: 0.333333333333333
    sigma: 0.192307692307692
    alpha: 0.99
    parallel_structure:
      compartments:
        unvaccinated:
          transmissibility_reduction:
            distribution: fixed
            value: 0
          susceptibility_reduction:
            distribution: fixed
            value: 0
        first_dose:
          transmissibility_reduction:
            distribution: fixed
            value: 0
          susceptibility_reduction:
            distribution: fixed
            value: 0.5
        second_dose:
          transmissibility_reduction:
            distribution: fixed
            value: 0
          susceptibility_reduction:
            distribution: fixed
            value: 0.9
      transitions:
        - from: unvaccinated
          to: first_dose
          rate:
            distribution: fixed
            value: 0
        - from: first_dose
          to: second_dose
          rate:
            distribution: fixed
            value: 0.04

